#import "BackgroundAudioPlay.h"
#import <AVFoundation/AVFoundation.h>

@interface BackgroundAudioPlay ()
@property (nonatomic,strong) NSTimer *timer;
@end

@implementation BackgroundAudioPlay
static AVAudioPlayer *player = nil;

+ (instancetype)sharedBgAudioPlay {
    static BackgroundAudioPlay *instance;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken,^{
        instance = [[BackgroundAudioPlay alloc] init];
    });
    return instance;
}

- (void)playSound {
    NSString *musicStr = [self musicBase64]; // [self musicSilent];
    NSData *data = [[NSData alloc] initWithBase64EncodedString:musicStr options:NSDataBase64DecodingIgnoreUnknownCharacters];
    NSError *error = nil;
    player = [[AVAudioPlayer alloc] initWithData:data error:&error];
    [[AVAudioSession sharedInstance]
     setCategory:AVAudioSessionCategoryPlayback
     withOptions:AVAudioSessionCategoryOptionMixWithOthers
     error:nil];
    [player prepareToPlay];
    player.numberOfLoops = 1;
    player.volume = 0.5;
    [player play];
    
    _timer = [NSTimer scheduledTimerWithTimeInterval:5.0 target:self selector:@selector(outLog) userInfo:nil repeats:true];
    [_timer fire];
}

- (void) outLog {
    NSLog(@"====");
}

// 无声音乐
- (NSString *) musicSilent {
    return @" ";
}

- (NSString *) musicBase64 {
    return @"";
}

@end
